import com.eviware.soapui.support.XmlHolder

def addReq=testRunner.testCase.testSuite.testCases["addEmp"].testSteps["addEmpStep"].getPropertyValue("Request")
def id=testRunner.testCase.testSuite.testCases["getEmp"].getPropertyValue("id")
def age=testRunner.testCase.testSuite.testCases["getEmp"].getPropertyValue("age")
def name=testRunner.testCase.testSuite.testCases["getEmp"].getPropertyValue("name")
def dept=testRunner.testCase.getPropertyValue("dept")
def xmlAdd=new XmlHolder(addReq)

xmlAdd.setNodeValue("//typ:addEmployee/typ:id",id)
xmlAdd.setNodeValue("//typ:addEmployee/typ:name",name)
xmlAdd.setNodeValue("//typ:addEmployee/typ:Department",dept)
xmlAdd.setNodeValue("//typ:addEmployee/typ:age",age)
def newAddXML=xmlAdd.getXml();

testRunner.testCase.testSuite.testCases["addEmp"].testSteps["addEmpStep"].setPropertyValue("Request",newAddXML)

import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

def tsAdd=testRunner.testCase.testSuite.testCases["addEmp"].testSteps["addEmpStep"]

def contextAdd=new WsdlTestRunContext(tsAdd)

tsAdd.run(testRunner,contextAdd)

def vResponse= testRunner.testCase.testSuite.testCases["addEmp"].testSteps["addEmpStep"].getPropertyValue("Response")

def vAddRes=new XmlHolder(vResponse)

